import React from 'react'

function TaskListNewRow(props) {
    return (
        <div className={'edit-row'}>
            <input
                value={props.taskList}
                type={'text'}
                onChange={(e) => props.handlerDescChange(e.target.value)}
            />
            <button
                onClick={props.handlerSubmitCreationClick}
            >
                Create
            </button>
            <button
                onClick={props.handlerCancelCreationClick}
            >
                Cancel
            </button>
        </div>
    );
}

export default TaskListNewRow;
